import './App.css';
import Menu from './componentes/menu';
import Inicio from './componentes/inicio';
import Nosotros from './componentes/Nosotros';
import Servicios from './componentes/Servicios';

function App() {
  return (
    <div >
      <Menu />
      <Inicio />
      <Nosotros />
      <Servicios />
    </div>
  );
}

export default App;
